import React from 'react'

const Event2 = () => {

    let sum = (a)=>{
        console.log(a);
    }
  return (
    <div className="container my-5" style={{minHeight : "650px"}}>
        <div className="row">
            <div className="col-md-12">
                <button onClick={(event)=>sum(event)} className='btn btn-primary'>Sum</button>
            </div>
        </div>
    </div>
  )
}

export default Event2
